import React, { useEffect, useState } from 'react';
import { jwtDecode } from 'jwt-decode';
import Navbar from '../components/LoginNavbar';


const featuresList = [
    {
        title: "LIMITLESS SHADES AND FINISHES",
        description: "Experiment with new finishes and play with colors to find the right match for you in just a few clicks.",
        image: featureImage1,
        link: '/shades-try-on'
    },
    {
        title: "ACNE DETECTION",
        description: "In the mood for epic artistry or a work-from-home glow? Pick your favorite looks from our looks catalog, try it on, and shop!",
        image: featureImage2,
        link: '/acne-detection'
    }
];
function Dashboard() {
    const [userName, setUserName] = useState('');

    useEffect(() => {
        // Get the token from localStorage
        const token = localStorage.getItem('token');
        
        if (token) {
            // Decode the token to get user information
            const decodedToken = jwtDecode(token);
            setUserName(decodedToken.name); // Assuming the token contains 'name'
        }
    }, []);

    return (
        <>
        <div>
            {/* Reuse Navbar */}
            <Navbar /> 

            {/* Dashboard Content */}
            <div className="dashboard-content">
                <h1>Welcome, {userName}!</h1>
                <div className="profile-section">
                    <img src="/default-profile.jpg" alt="Profile" className="profile-pic" />
                    <button className="btn-update-profile">Update Profile</button>
                </div>


                <div className="container">
            <div className="row">
            <div className="containerFeatures my-5">
                <h2 className="text-center">Our Features</h2>
                <p className="text-center tagline">Discover the perfect blend of beauty and technology.</p>
                <div className="features-grid container">
                    {featuresList.map((feature, index) => (
                        <div className="feature-card" key={index}>
                            <img src={feature.image} className="feature-img" alt={`${feature.title} Image`} />
                            <div className="card-body">
                                <h3 className="card-title">{feature.title}</h3>
                                <p className="card-text">{feature.description}</p>
                                <a href={feature.link} className="btn feature-btn">Try It On</a>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
            </div>
        </div>
                {/* Features Section */}
                <div className="features-section">
                    <div className="feature-card">
                        <h2>My Saved Looks</h2>
                        {/* Map over saved looks */}
                        <div className="saved-looks">
                            {/* Placeholder for saved looks */}
                        </div>
                    </div>

                    <div className="feature-card">
                        <h2>Try-On History</h2>
                        {/* Map over try-on history */}
                        <div className="tryon-history">
                            {/* Placeholder for try-on history */}
                        </div>
                    </div>
                </div>

                {/* Occasion-based Recommendations */}
                <div className="occasions-section">
                    <h2>Occasion-based Looks</h2>
                    <div className="occasions-cards">
                        <div className="occasion-card">Party</div>
                        <div className="occasion-card">Office</div>
                        <div className="occasion-card">Wedding</div>
                    </div>
                </div>
                <div className="occasions-container">
                <h2 className="text-center">Special Occasions</h2>
                <p className="text-center tagline">Choose makeup for special events</p>

                {selectedEvent && (
                    <div className="expanded-event-card">
                        <button className="back-button" onClick={() => setSelectedEvent(null)}>← Back</button>
                        <div className="expanded-content">
                            <div className="camera-try-wrapper">
                                <CameraTry />
                            </div>
                            <div className="event-content">
                                <h3 className="card-title">{selectedEvent.title}</h3>
                                <p>{selectedEvent.description}</p>
                                <MakeupList makeupStyles={makeupStyles} /> {/* Render makeup styles */}
                            </div>
                        </div>
                    </div>
                )}

                <div className={`grid-container ${selectedEvent ? 'hidden' : ''}`}>
                    {EventsList.map((event, index) => (
                        <div
                            key={index}
                            className="event-card"
                            onClick={() => handleEventClick(event)}
                        >
                            <h3 className="card-title">{event.title}</h3>
                            <p>{event.description}</p>
                        </div>
                    ))}
                </div>
            </div>
            
                {/* Recent Activity */}
                <div className="recent-activity">
                    <h2>Recent Activity</h2>
                    <p>You tried Lipstick X on [date]</p>
                    <p>Saved a look featuring Brand Y</p>
                </div>
            </div>
        </div>
        </>
    );
}

export default Dashboard;
